  SyncController,
  TakeActionController,
  UninstallController,
].reduce((acc, controller) => {
  const instance = new controller();
  if (!instance.methodName) {
    throw new Error(`Fatal: Controller has no method name`);
  }
  if (acc[instance.methodName]) {
    throw new Error(`Fatal: Multiple controllers connected to ${instance.methodName}`);
  }
  acc[instance.methodName] = instance.executeMethod.bind(instance);
  return acc;
}, {})

async function* (context: Context) {
    const {
      preProtocolStateChannel,
      message: { params, processID },
    } = context;
    const log = context.log.newContext("CF-InstallProtocol");
    const start = Date.now();
    let substart = start;
    log.info(`[${processID}] Initiation started`);
    log.debug(`[${processID}] Protocol initiated with parameters ${stringify(params)}`);

    if (!preProtocolStateChannel) {
      throw new Error("No state channel found for install");
    }

    const { proposal: proposalJson, responderIdentifier } = params as ProtocolParams.Install;

    const proposal = AppInstance.fromJson(proposalJson);

    // 0ms
    assertSufficientFundsWithinFreeBalance(
      preProtocolStateChannel,
      proposal.initiatorIdentifier,
      getAddressFromAssetId(proposal.initiatorDepositAssetId),
      toBN(proposal.initiatorDeposit),
    );

    // 0ms
    assertSufficientFundsWithinFreeBalance(
      preProtocolStateChannel,
      proposal.responderIdentifier,
      getAddressFromAssetId(proposal.responderDepositAssetId),
      toBN(proposal.responderDeposit),
    );

    const stateChannelAfter = computeInstallStateChannelTransition(
      preProtocolStateChannel,
      proposal,
    );

    const newAppInstance = stateChannelAfter.getAppInstance(proposal.identityHash);

    // safe to do here, nothing is signed or written to store
    const error = yield [
      OP_VALIDATE,
      protocol,
      {
        params,
        stateChannel: preProtocolStateChannel.toJson(),
        appInstance: newAppInstance.toJson(),
        role: ProtocolRoles.initiator,
      } as InstallMiddlewareContext,
    ];
    if (!!error) {
      throw new Error(error);
    }
    logTime(log, substart, `[${processID}] Validated app ${newAppInstance.identityHash}`);
    substart = Date.now();

    const freeBalanceUpdateData = getSetStateCommitment(context, stateChannelAfter.freeBalance);
    const freeBalanceUpdateDataHash = freeBalanceUpdateData.hashToSign();

    // 12ms
    // always use free balance key to sign free balance update
    const mySignatureOnFreeBalanceStateUpdate = yield [OP_SIGN, freeBalanceUpdateDataHash];

    // 124ms
    const {
      data: {
        customData: { signature: counterpartySignatureOnFreeBalanceStateUpdate },
      },
    } = yield [
      IO_SEND_AND_WAIT,
      {
        processID,
        params,
        protocol,
        to: responderIdentifier,
        customData: {
          signature: mySignatureOnFreeBalanceStateUpdate,
        },
        seq: 1,
      } as ProtocolMessageData,
    ] as any;

    // 7ms
    // free balance addr signs conditional transactions
    substart = Date.now();

    // 0ms
    const responderSignerAddress = getSignerAddressFromPublicIdentifier(responderIdentifier);

    const isChannelInitiator = stateChannelAfter.multisigOwners[0] !== responderSignerAddress;

    // 7ms
    // always use free balance key to sign free balance update
    await assertIsValidSignature(
      responderSignerAddress,
      freeBalanceUpdateDataHash,
      counterpartySignatureOnFreeBalanceStateUpdate,
      `Failed to validate responders signature on free balance update in the install protocol. Our commitment: ${stringify(
        freeBalanceUpdateData.toJson(),
      )}`,
    );
    logTime(log, substart, `[${processID}] Verified responder's sig on free balance update`);
    substart = Date.now();

    // add signatures to commitment
    await freeBalanceUpdateData.addSignatures(
      isChannelInitiator
        ? (mySignatureOnFreeBalanceStateUpdate as any)
        : counterpartySignatureOnFreeBalanceStateUpdate,
      isChannelInitiator
        ? counterpartySignatureOnFreeBalanceStateUpdate
        : (mySignatureOnFreeBalanceStateUpdate as any),
    );

    yield [
      PERSIST_APP_INSTANCE,
      PersistAppType.CreateInstance,
      stateChannelAfter,
      newAppInstance,
      freeBalanceUpdateData,
    ];

    // 335ms
    logTime(log, start, `[${processID}] Initiation finished`);
  } as any

async function* (context: Context) {
    const {
      message: {
        params,
        processID,
        customData: { signature },
      },
      preProtocolStateChannel,
    } = context;
    const log = context.log.newContext("CF-InstallProtocol");
    const start = Date.now();
    let substart = start;
    log.info(`[${processID}] Response started`);
    log.debug(`[${processID}] Protocol response started with parameters ${stringify(params)}`);

    // Aliasing `signature` to this variable name for code clarity
    const counterpartySignatureOnFreeBalanceStateUpdate = signature;

    if (!preProtocolStateChannel) {
      throw new Error("No state channel found for install");
    }

    const { proposal: proposalJson, initiatorIdentifier } = params as ProtocolParams.Install;

    const proposal = AppInstance.fromJson(proposalJson);

    // 0ms
    assertSufficientFundsWithinFreeBalance(
      preProtocolStateChannel,
      proposal.initiatorIdentifier,
      getAddressFromAssetId(proposal.initiatorDepositAssetId),
      toBN(proposal.initiatorDeposit),
    );

    // 0ms
    assertSufficientFundsWithinFreeBalance(
      preProtocolStateChannel,
      proposal.responderIdentifier,
      getAddressFromAssetId(proposal.responderDepositAssetId),
      toBN(proposal.responderDeposit),
    );

    const stateChannelAfter = computeInstallStateChannelTransition(
      preProtocolStateChannel,
      proposal,
    );

    const newAppInstance = stateChannelAfter.getAppInstance(proposal.identityHash);

    // safe to do here, nothing is signed or written to store
    const error = yield [
      OP_VALIDATE,
      protocol,
      {
        params,
        stateChannel: preProtocolStateChannel.toJson(),
        appInstance: newAppInstance.toJson(),
        role: ProtocolRoles.responder,
      } as InstallMiddlewareContext,
    ];
    if (!!error) {
      throw new Error(error);
    }
    logTime(log, substart, `[${processID}] Validated app ${newAppInstance.identityHash}`);
    substart = Date.now();

    // 7ms
    // multisig owner always signs conditional tx
    const protocolInitiatorAddr = getSignerAddressFromPublicIdentifier(initiatorIdentifier);
    const freeBalanceUpdateData = getSetStateCommitment(context, stateChannelAfter.freeBalance);
    const freeBalanceUpdateDataHash = freeBalanceUpdateData.hashToSign();
    await assertIsValidSignature(
      protocolInitiatorAddr,
      freeBalanceUpdateDataHash,
      counterpartySignatureOnFreeBalanceStateUpdate,
      `Failed to validate initiators signature on conditional transaction commitment in the install protocol. Our commitment: ${stringify(
        freeBalanceUpdateData.toJson(),
      )}`,
    );
    logTime(log, substart, `[${processID}] Verified initiator's free balance update sig`);
    substart = Date.now();

    const mySignatureOnFreeBalanceStateUpdate = yield [OP_SIGN, freeBalanceUpdateDataHash];

    // add signature
    const isChannelInitiator = stateChannelAfter.multisigOwners[0] !== protocolInitiatorAddr;
    await freeBalanceUpdateData.addSignatures(
      isChannelInitiator
        ? (mySignatureOnFreeBalanceStateUpdate as any)
        : counterpartySignatureOnFreeBalanceStateUpdate,
      isChannelInitiator
        ? counterpartySignatureOnFreeBalanceStateUpdate
        : (mySignatureOnFreeBalanceStateUpdate as any),
    );

    // 13ms
    yield [
      PERSIST_APP_INSTANCE,
      PersistAppType.CreateInstance,
      stateChannelAfter,
      newAppInstance,
      freeBalanceUpdateData,
    ];
    logTime(log, substart, `[${processID}] Persisted app ${newAppInstance.identityHash}`);
    substart = Date.now();

    // 154ms
    yield [
      IO_SEND,
      {
        processID,
        protocol,
        to: initiatorIdentifier,
        customData: {
          signature: mySignatureOnFreeBalanceStateUpdate,
        },
        seq: UNASSIGNED_SEQ_NO,
      } as ProtocolMessageData,
      stateChannelAfter,
    ] as any;

    // 272ms
    logTime(log, start, `[${processID}] Response finished`);
  } as any

async function* (context: Context & { preProtocolChannel: StateChannel }) {
    const { message, network } = context;
    const log = context.log.newContext("CF-SetupProtocol");
    const start = Date.now();
    let substart;
    const { processID, params } = message;
    log.info(`[${processID}] Initiation started`);
    log.debug(`[${processID}] Protocol initiated with parameters ${stringify(params)}`);

    const {
      multisigAddress,
      responderIdentifier,
      initiatorIdentifier,
    } = params as ProtocolParams.Setup;

    const error = yield [
      OP_VALIDATE,
      protocol,
      { params, role: ProtocolRoles.initiator } as SetupMiddlewareContext,
    ];
    if (!!error) {
      throw new Error(error);
    }

    // 56 ms
    const stateChannel = StateChannel.setupChannel(
      network.contractAddresses.IdentityApp,
      network.contractAddresses,
      multisigAddress,
      initiatorIdentifier,
      responderIdentifier,
    );

    const setupCommitment = getSetupCommitment(context, stateChannel);

    // setup installs the free balance app, and on creation the state channel
    // will have nonce 1, so use hardcoded 0th key
    // 32 ms
    const mySetupSignature = yield [OP_SIGN, setupCommitment.hashToSign()];

    // 32 ms
    const freeBalanceUpdateData = getSetStateCommitment(context, stateChannel.freeBalance);
    const mySignatureOnFreeBalanceState = yield [OP_SIGN, freeBalanceUpdateData.hashToSign()];

    // 201 ms (waits for responder to respond)
    substart = Date.now();
    const {
      data: {
        customData: {
          setupSignature: responderSetupSignature,
          setStateSignature: responderSignatureOnFreeBalanceState,
        },
      },
    } = yield [
      IO_SEND_AND_WAIT,
      {
        protocol,
        processID,
        params,
        seq: 1,
        to: responderIdentifier,
        customData: {
          setupSignature: mySetupSignature,
          setStateSignature: mySignatureOnFreeBalanceState,
        },
      } as ProtocolMessageData,
    ] as any;
    logTime(log, substart, `[${processID}] Received responder's sigs`);

    // setup installs the free balance app, and on creation the state channel
    // will have nonce 1, so use hardcoded 0th key
    // 68 ms
    substart = Date.now();
    const responderAddr = getSignerAddressFromPublicIdentifier(responderIdentifier);
    await assertIsValidSignature(
      responderAddr,
      setupCommitment.hashToSign(),
      responderSetupSignature,
    );
    await assertIsValidSignature(
      responderAddr,
      freeBalanceUpdateData.hashToSign(),
      responderSignatureOnFreeBalanceState,
    );
    logTime(log, substart, `[${processID}] Verified responder's sigs`);

    // add sigs to commitments
    await setupCommitment.addSignatures(mySetupSignature as any, responderSetupSignature);

    await freeBalanceUpdateData.addSignatures(
      mySignatureOnFreeBalanceState as any,
      responderSignatureOnFreeBalanceState,
    );

    yield [
      PERSIST_STATE_CHANNEL,
      PersistStateChannelType.CreateChannel,
      stateChannel,
      [await setupCommitment.getSignedTransaction(), freeBalanceUpdateData],
    ];

    logTime(log, start, `[${processID}] Initiation finished`);
  } as any

async function* (context: Context) {
    const { message, network, preProtocolStateChannel } = context;
    const log = context.log.newContext("CF-TakeActionProtocol");
    const start = Date.now();
    let substart = start;
    const { processID, params } = message;
    log.info(`[${processID}] Initiation started`);
    log.debug(`[${processID}] Protocol initiated with params: ${stringify(params)}`);

    const {
      appIdentityHash,
      responderIdentifier,
      action,
      stateTimeout,
    } = params as ProtocolParams.TakeAction;

    if (!preProtocolStateChannel) {
      throw new Error("No state channel found for takeAction");
    }

    // 8ms
    const preAppInstance = preProtocolStateChannel.getAppInstance(appIdentityHash);

    const error = yield [
      OP_VALIDATE,
      protocol,
      {
        params,
        appInstance: preAppInstance.toJson(),
        role: ProtocolRoles.initiator,
        stateChannel: preProtocolStateChannel.toJson(),
      } as TakeActionMiddlewareContext,
    ];
    if (!!error) {
      throw new Error(error);
    }
    logTime(log, substart, `[${processID}] Validated action`);
    substart = Date.now();

    // 40ms
    const postProtocolStateChannel = preProtocolStateChannel.setState(
      preAppInstance,
      await preAppInstance.computeStateTransition(action, network.provider),
      stateTimeout,
    );
    logTime(log, substart, `[${processID}] Updated channel with new app state`);
    substart = Date.now();

    // 0ms
    const appInstance = postProtocolStateChannel.getAppInstance(appIdentityHash);

    // 0ms
    const responderAddr = getSignerAddressFromPublicIdentifier(responderIdentifier);

    const setStateCommitment = getSetStateCommitment(context, appInstance);
    const setStateCommitmentHash = setStateCommitment.hashToSign();

    // 6ms
    const mySignature = yield [OP_SIGN, setStateCommitmentHash];

    // add singly signed set state commitment to store without overwriting
    // or removing previous set state commitment to allow watcher service
    // to dispute using the `progressState` or `setAndProgressState` paths
    // using only items in the store
    const isAppInitiator = appInstance.initiatorIdentifier !== responderIdentifier;
    await setStateCommitment.addSignatures(
      isAppInitiator ? (mySignature as any) : undefined,
      isAppInitiator ? undefined : (mySignature as any),
    );

    // also save the app instance with a `latestAction`
    yield [
      PERSIST_APP_INSTANCE,
      PersistAppType.UpdateInstance,
      preProtocolStateChannel,
      preAppInstance.setAction(action),
      setStateCommitment,
    ];

    // 117ms
    const {
      data: {
        customData: { signature: counterpartySig },
      },
    } = yield [
      IO_SEND_AND_WAIT,
      {
        protocol,
        processID,
        params,
        seq: 1,
        to: responderIdentifier,
        customData: {
          signature: mySignature,
        },
      } as ProtocolMessageData,
    ] as any;

    // 10ms
    await assertIsValidSignature(
      responderAddr,
      setStateCommitmentHash,
      counterpartySig,
      `Failed to validate responder's signature on initial set state commitment in the take-action protocol. Our commitment: ${stringify(
        setStateCommitment.toJson(),
      )}`,
    );
    logTime(log, substart, `[${processID}] Verified responders signature`);
    substart = Date.now();

    // add signatures and write commitment to store
    await setStateCommitment.addSignatures(
      isAppInitiator ? (mySignature as any) : counterpartySig,
      isAppInitiator ? counterpartySig : (mySignature as any),
    );

    // add sigs to most recent set state
    yield [
      PERSIST_APP_INSTANCE,
      PersistAppType.UpdateInstance,
      postProtocolStateChannel,
      appInstance,
      setStateCommitment,
    ];

    logTime(log, start, `[${processID}] Finished Initiating`);
  } as any

async function* (context: Context) {
    const { message, network, preProtocolStateChannel } = context;
    const log = context.log.newContext("CF-UninstallProtocol");
    const start = Date.now();
    let substart = start;
    const { params, processID } = message;
    log.info(`[${processID}] Initiation started`);
    log.debug(`[${processID}] Protocol initiated with params ${stringify(params)}`);

    const {
      responderIdentifier,
      appIdentityHash,
      action,
      stateTimeout,
    } = params as ProtocolParams.Uninstall;

    if (!preProtocolStateChannel) {
      throw new Error("No state channel found for uninstall");
    }
    const appToUninstall = preProtocolStateChannel.getAppInstance(appIdentityHash);

    const error = yield [
      OP_VALIDATE,
      protocol,
      {
        params,
        appInstance: appToUninstall.toJson(),
        role: ProtocolRoles.initiator,
        stateChannel: preProtocolStateChannel.toJson(),
      } as UninstallMiddlewareContext,
    ];
    if (!!error) {
      throw new Error(error);
    }
    logTime(log, substart, `[${processID}] Validated uninstall request`);
    substart = Date.now();

    let preUninstallStateChannel: StateChannel;
    if (action) {
      log.info(`Action provided. Finalizing app before uninstall`);
      // apply action
      const newState = await appToUninstall.computeStateTransition(action, network.provider);
      // ensure state is finalized after applying action
      const isFinal = await appToUninstall.isStateTerminal(newState, network.provider);
      if (!isFinal) {
        throw new Error(`Action provided did not lead to terminal state, refusing to uninstall.`);
      }
      log.debug(`Resulting state is terminal state, proceeding with uninstall`);
      preUninstallStateChannel = preProtocolStateChannel.setState(
        appToUninstall,
        newState,
        stateTimeout,
      );
    } else {
      preUninstallStateChannel = preProtocolStateChannel;
    }
    // make sure the uninstalled app is the finalized app
    const preUninstallApp = preUninstallStateChannel.appInstances.get(appToUninstall.identityHash)!;

    // 47ms
    const postProtocolStateChannel = await computeStateTransition(
      params as ProtocolParams.Uninstall,
      network.provider,
      preUninstallStateChannel,
      preUninstallApp,
      log,
    );

    // 0ms
    const responderFreeBalanceKey = getSignerAddressFromPublicIdentifier(responderIdentifier);

    const uninstallCommitment = getSetStateCommitment(
      context,
      postProtocolStateChannel.freeBalance,
    );
    const uninstallCommitmentHash = uninstallCommitment.hashToSign();

    // 4ms
    const mySignature = yield [OP_SIGN, uninstallCommitmentHash];
    logTime(log, substart, `[${processID}] Signed uninstall commitment initiator`);
    substart = Date.now();

    // 94ms
    const {
      data: {
        customData: { signature: counterpartySignature },
      },
    } = yield [
      IO_SEND_AND_WAIT,
      {
        protocol,
        processID,
        params,
        to: responderIdentifier,
        customData: { signature: mySignature },
        seq: 1,
      } as ProtocolMessageData,
    ] as any;

    // 6ms
    await assertIsValidSignature(
      responderFreeBalanceKey,
      uninstallCommitmentHash,
      counterpartySignature,
      `Failed to validate responder's signature on free balance commitment in the uninstall protocol. Our commitment: ${stringify(
        uninstallCommitment.toJson(),
      )}`,
    );
    logTime(log, substart, `[${processID}] Verified responder's sig`);

    const isInitiator = postProtocolStateChannel.multisigOwners[0] !== responderFreeBalanceKey;
    // use channel initiator bc free balance app
    await uninstallCommitment.addSignatures(
      isInitiator ? (mySignature as any) : counterpartySignature,
      isInitiator ? counterpartySignature : (mySignature as any),
    );

    // 24ms
    yield [
      PERSIST_APP_INSTANCE,
      PersistAppType.RemoveInstance,
      postProtocolStateChannel,
      preUninstallApp,
      uninstallCommitment,
    ];

    // 204ms
    logTime(log, start, `[${processID}] Initiation finished`);
  } as any
